import React, { useState, useEffect } from 'react';

const API_BASE_URL = 'http://localhost:3000';

const Card = ({ children, className = '', ...props }) => (
  <div 
    className={`bg-white rounded-lg shadow-md overflow-hidden ${className}`} 
    {...props}
  >
    {children}
  </div>
);

const CardHeader = ({ children, className = '', ...props }) => (
  <div 
    className={`p-4 border-b border-gray-200 ${className}`} 
    {...props}
  >
    {children}
  </div>
);

const CardContent = ({ children, className = '', ...props }) => (
  <div 
    className={`p-4 ${className}`} 
    {...props}
  >
    {children}
  </div>
);

const TribunaisListing = () => {
  const [tribunais, setTribunais] = useState([]);
  const [selectedTribunal, setSelectedTribunal] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [avaliacoes, setAvaliacoes] = useState({});

  useEffect(() => {
    fetchTribunais();
  }, []);

  const fetchTribunais = async () => {
    try {
      const response = await fetch(`${API_BASE_URL}/tribunais`);
      if (!response.ok) throw new Error('Erro ao carregar dados');
      const data = await response.json();
      setTribunais(data);
      
      // Buscar avaliações para cada tribunal
      data.forEach(tribunal => {
        fetchAvaliacaoTribunal(tribunal.id_tribunal);
      });
      
      setLoading(false);
    } catch (err) {
      setError('Erro ao carregar os tribunais');
      setLoading(false);
    }
  };

  const fetchAvaliacaoTribunal = async (id_tribunal) => {
    try {
      const response = await fetch(`${API_BASE_URL}/tribunais_avaliacao/${id_tribunal}`);
      if (!response.ok) throw new Error('Erro ao carregar avaliação');
      const data = await response.json();
      setAvaliacoes(prev => ({
        ...prev,
        [id_tribunal]: data.media_ponderada
      }));
    } catch (err) {
      console.error('Erro ao carregar avaliação:', err);
    }
  };

  const fetchTribunalDetails = async (id) => {
    try {
      const response = await fetch(`${API_BASE_URL}/tribunais/${id}`);
      if (!response.ok) throw new Error('Erro ao carregar detalhes');
      const data = await response.json();
      setSelectedTribunal(data);
    } catch (err) {
      setError('Erro ao carregar detalhes do tribunal');
    }
  };

  if (loading) return (
    <div className="flex justify-center items-center h-64">
      <p className="text-lg">Carregando...</p>
    </div>
  );

  if (error) return (
    <div className="flex justify-center items-center h-64">
      <p className="text-red-500">{error}</p>
    </div>
  );

  return (
    <div className="max-w-6xl mx-auto p-4">
      {/* Breadcrumb */}
      <div className="flex items-center gap-2 text-sm text-gray-600 mb-6">
        <span>Início</span>
        <span className="text-gray-400">/</span>
        <span>Tribunais</span>
      </div>

      {/* Title */}
      <h1 className="text-3xl font-bold mb-8">
        Tribunais e Órgãos Jurídicos
      </h1>

      {/* Cards Grid */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
        {tribunais.map((tribunal) => (
          <Card 
            key={tribunal.id_tribunal}
            className="hover:shadow-lg transition-shadow cursor-pointer"
            onClick={() => fetchTribunalDetails(tribunal.id_tribunal)}
          >
            <CardHeader className="flex flex-row items-center gap-4">
              <div className="w-12 h-12 bg-blue-100 rounded-full flex items-center justify-center">
                {tribunal.imagem ? (
                  <img 
                    src={`${API_BASE_URL}${tribunal.imagem}`} 
                    alt={tribunal.nome}
                    className="w-10 h-10 rounded-full object-cover"
                  />
                ) : (
                  <svg 
                    className="w-6 h-6 text-blue-600" 
                    fill="none" 
                    stroke="currentColor" 
                    viewBox="0 0 24 24"
                  >
                    <path 
                      strokeLinecap="round" 
                      strokeLinejoin="round" 
                      strokeWidth={2} 
                      d="M19 21V5a2 2 0 00-2-2H7a2 2 0 00-2 2v16m14 0h2m-2 0h-5m-9 0H3m2 0h5M9 7h1m-1 4h1m4-4h1m-1 4h1m-5 10v-5a1 1 0 011-1h2a1 1 0 011 1v5m-4 0h4" 
                    />
                  </svg>
                )}
              </div>
              <div>
                <h2 className="font-semibold">{tribunal.nome}</h2>
                <div className="flex items-center gap-1">
                  <svg 
                    className="w-4 h-4 text-yellow-400 fill-current" 
                    viewBox="0 0 20 20"
                  >
                    <path d="M9.049 2.927c.3-.921 1.603-.921 1.902 0l1.07 3.292a1 1 0 00.95.69h3.462c.969 0 1.371 1.24.588 1.81l-2.8 2.034a1 1 0 00-.364 1.118l1.07 3.292c.3.921-.755 1.688-1.54 1.118l-2.8-2.034a1 1 0 00-1.175 0l-2.8 2.034c-.784.57-1.838-.197-1.539-1.118l1.07-3.292a1 1 0 00-.364-1.118L2.98 8.72c-.783-.57-.38-1.81.588-1.81h3.461a1 1 0 00.951-.69l1.07-3.292z" />
                  </svg>
                  <span className="text-sm text-gray-600">
                    {avaliacoes[tribunal.id_tribunal]?.toFixed(1) || tribunal.avaliacao_media || "N/A"}
                  </span>
                </div>
                <p className="text-sm text-gray-600">{tribunal.cidade} - {tribunal.estado}</p>
              </div>
            </CardHeader>
            <CardContent>
              <p className="text-sm text-gray-600">
                {tribunal.endereco}
                <br />
                CEP: {tribunal.cep}
              </p>
              <button
                className="mt-4 w-full bg-blue-600 text-white py-2 px-4 rounded hover:bg-blue-700 transition-colors"
                onClick={(e) => {
                  e.stopPropagation();
                  window.location.href = `/tribunal/${tribunal.id_tribunal}`;
                }}
              >
                Ver detalhes
              </button>
            </CardContent>
          </Card>
        ))}
      </div>

      {/* Selected Tribunal Details Modal */}
      {selectedTribunal && (
        <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center p-4 z-50">
          <Card className="w-full max-w-2xl">
            <CardHeader>
              <div className="flex justify-between items-start">
                <div>
                  <h2 className="text-xl font-bold">{selectedTribunal.nome}</h2>
                  <p className="text-sm text-gray-600">
                    {selectedTribunal.cidade} - {selectedTribunal.estado}
                  </p>
                </div>
                <button
                  onClick={() => setSelectedTribunal(null)}
                  className="text-gray-500 hover:text-gray-700"
                >
                  ✕
                </button>
              </div>
            </CardHeader>
            <CardContent>
              <div className="space-y-4">
                <div className="flex items-center gap-4">
                  {selectedTribunal.imagem && (
                    <img 
                      src={`${API_BASE_URL}${selectedTribunal.imagem}`} 
                      alt={selectedTribunal.nome}
                      className="w-24 h-24 rounded-lg object-cover"
                    />
                  )}
                  <div>
                    <p className="text-gray-600">{selectedTribunal.endereco}</p>
                    <p className="text-gray-600">CEP: {selectedTribunal.cep}</p>
                    <div className="flex items-center gap-1 mt-2">
                      <svg 
                        className="w-5 h-5 text-yellow-400 fill-current" 
                        viewBox="0 0 20 20"
                      >
                        <path d="M9.049 2.927c.3-.921 1.603-.921 1.902 0l1.07 3.292a1 1 0 00.95.69h3.462c.969 0 1.371 1.24.588 1.81l-2.8 2.034a1 1 0 00-.364 1.118l1.07 3.292c.3.921-.755 1.688-1.54 1.118l-2.8-2.034a1 1 0 00-1.175 0l-2.8 2.034c-.784.57-1.838-.197-1.539-1.118l1.07-3.292a1 1 0 00-.364-1.118L2.98 8.72c-.783-.57-.38-1.81.588-1.81h3.461a1 1 0 00.951-.69l1.07-3.292z" />
                      </svg>
                      <span className="text-lg font-semibold">
                        {avaliacoes[selectedTribunal.id_tribunal]?.toFixed(1) || selectedTribunal.avaliacao_media || "N/A"}
                      </span>
                    </div>
                  </div>
                </div>
                <button
                  className="w-full bg-blue-600 text-white py-2 px-4 rounded hover:bg-blue-700 transition-colors"
                  onClick={() => window.location.href = `/tribunal/${selectedTribunal.id_tribunal}`}
                >
                  Ver página completa
                </button>
              </div>
            </CardContent>
          </Card>
        </div>
      )}
    </div>
  );
};

export default TribunaisListing;
